import React from 'react';

function NavBar() {
  return (
    <nav>
      <ul>
        <li>
          <a href="./index.tsx">Home</a>
        </li>
        <li>
          <a href="./movies.tsx">About</a>
        </li>
        <li>
          <a href="/podcasts.tsx">Contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
